import React from 'react'
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Navbar from 'react-bootstrap/Navbar';
import "../CSS/sidebar.css";

function sidebar() {
  return (
    <div>
      <Navbar expand="lg" className="bg-body-tertiary flex-column side-bar">
        <Container fluid className='d-flex flex-column'>
          <Navbar.Brand className='pb-2' href="#"><i className="bi bi-geo-alt"></i><p>Location</p></Navbar.Brand>
          <Navbar.Toggle aria-controls="navbarScroll" />
          <Navbar.Collapse id="navbarScroll" className="flex-column">

            <Form className="d-flex flex-column p-2">
              <Form.Control
                type="search"
                placeholder="Search"
                className="me-2 mb-2"
                aria-label="Search"
              />
              <Button variant="outline-success">Search</Button>
            </Form>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </div>
  )
}

export default sidebar
